      and election of candidates from City Council and School Board all the way up
      to Nevada State Assembly and Nevada State Senate.    On a monthly basis, the
      Executive Director completes a Payroll Log and certifies to the Treasurer if
      'None,' '25 percent or less' or 'more than 25 percent' of compensated time was
      spent on Federal Election Activity (FEA). The employee has been educated as
      to the components of FEA.    For the months in question - and for every month
      in 2007 and thus far in 2008 - the Executive Director has submitted certification
      that '25 percent or less' of compensated time was spent on FEA. Based on observation
      of the duties and accomplishments of the Executive Director during the time
      period in question, the Treasurer has every reason to believe this certification
      is accurate.     The Committee did, in fact, compensate the Executive Director
      with 100% federal funds - as Operating Expense (Other Federal Operating Expenditures)
      reported on Line 21(b) - in most cases during this time period; a lack of Nonfederal
      funds hampered the Committee's ability to allocate what qualifies as Administrative
      Expense that could have been allocated on Lines 21(a)(i) and 21(a)(ii).     In
      these amendments the Committee has clarified various prior references used for
      salaries and wages during the above-referenced periods to a standardized label
      'Salaries and Wages' and has provided an additional memo on each payroll transaction
      to clarify that the classification as non-FEA is based on an employee certification
      in file.    There is no monetary impact based on these modifications.     The
      Committee appreciates the Commission bringing this matter to our attention,
      and will be certain to continue to allocate Salaries and Wages (along with associated
      benefit and payroll tax expense) between Federal and Nonfederal accounts only
      when it is clear and can be documented that the employee in question spent no
      more than 25% of the  compensated time on FEA.     The Committee is dedicated
      to compliance with the FEC, and to that end the Treasurer and Executive Director
      will attend and participate in the FEC Conference for Political Party Committees
      in Washington, DC in April, 2008.
